    [In Review]",nt"tracking_summary": {ntt"total": 21,ntt"recent": 3nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T22:45:51.662684",nt"name":
    "national-protocol-framework-for-the-inventory-and-monitoring-of-migratory-shorebirds",nt"isopen":
    false,nt"url": null,nt"notes": "This protocol framework provides guidance
    for conducting inventory and monitoring of migrating and wintering shorebirds in
    all potential habitats at multiple stations within two or more regions. The protocol
    described in this document is meant to be used to monitor migrating and wintering
    shorebirds in all potential habitats within a refuge. The design is similar to that
    laid out by the Program for Regional and International Shorebird Monitoring (PRISM).
    PRISM outlines a systematic approach to sampling while the survey methods are compatible
    with the traditional ISS. The primary goal is to estimate the number of shorebirds
    utilizing stopover sites during the spring and fall migration. These sites can then
    be more effectively managed to conserve focal species on a regional or local level.
    The sampling frame is defined as all potential shorebird habitats within a refuge.
    These areas are then divided into plots. The sampling unit is defined as a plot
    at a particular point in time. Data are recorded at the plot level.",nt"license_title":
